import React from "react";

const Alarm = ({ alarm, onSave, onCancel, onDelete }) => {
  const handleSaveAlarm = () => {
    onSave(alarm); // Pass alarm object or relevant data
  };

  const handleCancelAlarm = () => {
    onCancel();
  };

  const handleDeleteAlarm = () => {
    onDelete();
  };

  return (
    <div>
      {/* Example form or input elements for editing alarm */}
      <input type="text" value={alarm.title} />
      <input type="time" value={alarm.time} />

      {/* Buttons for save, cancel, and delete */}
      <button onClick={handleSaveAlarm}>Save</button>
      <button onClick={handleCancelAlarm}>Cancel</button>
      <button onClick={handleDeleteAlarm}>Delete</button>
    </div>
  );
};

export default Alarm;
